	var utils = new global.lmsGlobalUtils();
	//Get on call training tech mobile number
	var onCallTech = utils.getOnCallTech(current.variables.item.access_group.sys_id.toString());
	if(onCallTech){
		gs.info("Prakash LMS WF: onCall tech for training group - " +  onCallTech.name.toString());
		var msg = "Hello " + onCallTech.name.toString() + ',\n'
		+ "A new critical training task has been assigned to your group. \n"
		+ "Learning Item: " + current.variables.item.getDisplayValue().toString() + "\n"
		+ "Student: " + current.variables.student_ref.getDisplayValue().toString() + "\n"
		+ "Completion Date: " + current.variables.completion_date;
		var sms = utils.sms("", onCallTech.mobile_phone.toString(), msg, current);
	}
}
catch(ex){
	gs.error("Prakash LMS: Default workflow error while send sms to On-CAll Training Tech");
}

