cancelTimer();

function cancelTimer() {
	var timer = new GlideRecord('wf_executing');
	timer.addQuery('context', activity.context);
	timer.addQuery('activity.name', 'Auto-Close after 3days');
	timer.query();
	while(timer.next()) {
		new Workflow().fireEvent(timer, 'cancel');
	}
}

